def convert_weather_list(weather_list):
    new_weather_list = []
    for weather in weather_list:
        if '晴' in weather:
            new_weather_list.append('晴天')
        elif '云' in weather:
            new_weather_list.append('多云')
        elif '阴' in weather:
            new_weather_list.append('阴天')
        elif '雨' in weather:
            new_weather_list.append('暴雨')
        elif '雾' in weather:
            new_weather_list.append('雾')
        elif '霾' in weather:
            new_weather_list.append('天气-沙尘')
        elif '扬沙' in weather:
            new_weather_list.append('特大扬沙')
        elif '浮尘' in weather:
            new_weather_list.append('特大扬沙')
        elif '暴' in weather:
            new_weather_list.append('特大扬沙')
        else:
            new_weather_list.append(weather)
    return new_weather_list

